import { Question, AnswerCircle1, AnswerCircle2, AnswerCircle3 } from '../../assets/svg';
import styles from './game.module.css';

const Game = () => {
  return (
    <div>
        <div>

        </div>
        <div className={styles.game}>
            <Question/>
            <AnswerCircle1/>
            <AnswerCircle2/>
            <AnswerCircle3/>
        </div>
    </div>
  )
}

export default Game;
